//With the Mayle--Rouse code

SetSeed(508722640,0);
AttachSpec("../Modular/Modular.spec");
Attach("ModCrvToEC.m");
N := 20;
gens := [[0, 1, 11, 7], [0, 1, 19, 1], [0, 3, 1, 0], [0, 3, 13, 1], [0, 11, 1, 17], [1, 7, 11, 16]];
ModEC := InitializeModEC(N,gens : precmult := 2);
Iso, Mx := EllipticCurveQuoCandidates(ModEC);
map1 := FindMapsToEC(ModEC, [[ 0, 0, 0, 5, 10 ]], [1]); 
psi := map1[1];
map2 := FindMapsToEC(ModEC, [[ 0, -1, 0, 4, -4 ]], [1]); 
psi2 := map2[1];
P5<x,y,z,w,t,u> := Ambient(Domain(map1[1]));
X := Domain(map1[1]);
pts := PointSearch(X, 100);
assert psi2(pts[1]) eq psi2(pts[2]); //both map to F!0
assert psi1(pts[1]) ne psi1(pts[1]);
F := Codomain(psi2);
E := Codomain(psi1);
pre_im_psi1 := (psi1(pts[1]))@@psi1;
pre_im0 := (psi!0)@@psi2; 
assert Degree(pre_im0 meet pre_im_psi1) eq 1; //one point here
RationalPoints(pre_im0 meet pre_im_psi1); //in fact its the point we are looking for
pre_im_psi2 := (psi1(pts[2]))@@psi1;
assert Degree(pre_im0 meet pre_im_psi2) eq 1; //one point here
RationalPoints(pre_im0 meet pre_im_psi2); //also what we are looking for

